		ELSE
			UPDATE stock SET CantidadSTK = CantidadSTK - OLD.CantidadMSTKD
				WHERE IdArticuloSTK = OLD.IdArticuloMSTKD AND IdLocalSTK = OLD.DestinoMSTKD;
