/*!50003 CREATE*/ /*!50017 DEFINER=`ncsoftwa_re`@`%`*/ /*!50003 TRIGGER `ventas_insert_stock_updt` AFTER INSERT ON `ncsoftwa_re`.`ventasdetalle` FOR EACH ROW BEGIN
	UPDATE stock SET CantidadSTK = CantidadSTK - NEW.CantidadDVEN
	WHERE IdArticuloSTK = NEW.IdArticuloDVEN AND IdLocalSTK = NEW.IdLocalDVEN;
    END */;;
DELIMITER ;
