/*!50003 CREATE*/ /*!50020 DEFINER=`ncsoftwa_re`@`%`*/ /*!50003 PROCEDURE `Web_Articulo`(IN p_local INT, IN p_articulo VARCHAR(10))
BEGIN
	DECLARE articulo_left VARCHAR(10);
